B.Ea=new A.f2("1. Coleta de Informa\xe7\xf5es",null)
B.E6=new A.f1("O aplicativo coleta dados pessoais b\xe1sicos dos usu\xe1rios, incluindo, mas n\xe3o se limitando a:\n\u2022 Nome completo;\n\u2022 Endere\xe7o de e-mail;\n\u2022 N\xfamero de telefone;\n\u2022 G\xeanero.\n\nEssas informa\xe7\xf5es s\xe3o essenciais para a identifica\xe7\xe3o, autentica\xe7\xe3o e comunica\xe7\xe3o dos funcion\xe1rios, al\xe9m do registro de atividades do sistema.",null)
B.Ee=new A.f2("2. Uso de Informa\xe7\xf5es",null)
B.E9=new A.f1("Os dados coletados s\xe3o utilizados para:\n\u2022 Gerenciar o acesso e a autentica\xe7\xe3o dos funcion\xe1rios no sistema;\n\u2022 Facilitar a comunica\xe7\xe3o e o suporte interno;\n\u2022 Monitorar e registrar as opera\xe7\xf5es do aplicativo, garantindo a seguran\xe7a das barragens e a integridade dos dados.",null)
B.Ec=new A.f2("3. Compartilhamento de Informa\xe7\xf5es",null)
B.E7=new A.f1("As informa\xe7\xf5es dos usu\xe1rios poder\xe3o ser compartilhadas:\n\u2022 Internamente, entre setores e equipes autorizadas da empresa, com o \xfanico objetivo de melhorar a gest\xe3o e a seguran\xe7a das opera\xe7\xf5es;\n\u2022 Com parceiros de tecnologia ou servi\xe7os, exclusivamente se necess\xe1rio para a manuten\xe7\xe3o ou atualiza\xe7\xe3o do sistema, sempre mediante contratos que garantam a prote\xe7\xe3o dos dados.",null)
B.Eg=new A.f2("4. Seguran\xe7a",null)
B.E3=new A.f1("Implementamos medidas t\xe9cnicas e administrativas compat\xedveis com os melhores padr\xf5es do mercado para proteger as informa\xe7\xf5es dos usu\xe1rios contra acesso n\xe3o autorizado, altera\xe7\xe3o, divulga\xe7\xe3o ou destrui\xe7\xe3o. Entre essas medidas est\xe3o:\n\u2022 Controles de acesso e autentica\xe7\xe3o;\n\u2022 Criptografia dos dados armazenados e transmitidos;\n\u2022 Monitoramento cont\xednuo e atualiza\xe7\xf5es de seguran\xe7a.",null)
B.Ef=new A.f2("5. Links Externos",null)
B.E4=new A.f1("O aplicativo pode conter links ou refer\xeancias a servi\xe7os e recursos externos. Ressaltamos que n\xe3o temos responsabilidade sobre as pr\xe1ticas de privacidade ou o conte\xfado desses sites, sendo recomendada a leitura das respectivas pol\xedticas de privacidade antes de fornecer qualquer informa\xe7\xe3o pessoal.",null)
B.Eb=new A.f2("6. Prote\xe7\xe3o de Dados de Menores",null)
B.E2=new A.f1("O aplicativo n\xe3o se destina \xe0 coleta de informa\xe7\xf5es de menores de idade. Caso seja identificado qualquer dado de usu\xe1rios menores de 18 anos sem a devida autoriza\xe7\xe3o, as medidas necess\xe1rias ser\xe3o adotadas para a remo\xe7\xe3o imediata das informa\xe7\xf5es.",null)
B.Eh=new A.f2("7. Altera\xe7\xf5es na Pol\xedtica de Privacidade",null)
B.E8=new A.f1("Esta pol\xedtica poder\xe1 ser atualizada periodicamente para refletir mudan\xe7as na legisla\xe7\xe3o ou melhorias em nossos processos internos. A data da \xfaltima atualiza\xe7\xe3o constar\xe1 no in\xedcio deste documento, e os usu\xe1rios ser\xe3o informados sobre quaisquer altera\xe7\xf5es relevantes.",null)
